import React from 'react';
import Card from './../../components/Card'
import Buttonn from "./../../components/Button"
import { Container, Input, Label } from './index.syles';
function Component() {
  return (
    <Container>
      <Card  >
        <Label>CPF</Label>
        <Input />
        <Label>Senha</Label>
        <Input />
        <Buttonn>Ola</Buttonn>
      </Card >
    </Container>
  );
}
